import styled from "styled-components";
import { Link } from "react-router-dom";

function Addfood() {
  return (
    <Main>
      <div className="container">
        <div>
          <div>
            <input placeholder="재료를 입력해주세요" />
          </div>
        </div>
        <div>
          <h2>분류</h2>
          <div></div>
        </div>
        <div className="datas">
          <div className="data">
            <h2>수량</h2>
            <input></input>
          </div>
          <div className="data">
            <h2>유통기한</h2>
            <input></input>
          </div>
          <div className="data">
            <h2>소비기한</h2>
            <input></input>
          </div>
        </div>
        <div>
          <Link to="/colder" className="bottomButton">
            냉장실에 추가하기 ╋
          </Link>
          <Link to="/freezer" className="bottomButton">
            냉동실에 추가하기 ╋
          </Link>
        </div>
      </div>
    </Main>
  );
}

export const Main = styled.div`
  height: 92.6vh;
  display: flex;
  justify-content: center;
  align-items: flex-end;
  .container {
    display: flex;
    flex-direction: column;
    align-items: center;
    height: 80vh;
    width: 40vw;
    background-color: #ffa249;
    border-top-left-radius: 30px;
    border-top-right-radius: 30px;
  }
  input::placeholder {
    color: FFA24B;
    background-color: beige;
  }
  .datas {
    justify-content: center;
    width: 30vw;
    /* display: flex;
    flex-direction: column; */
  }
  .data {
    display: flex;
    align-items: center;
    justify-content: space-between;
    input {
      height: 25px;
      border-radius: 7px;
      border: none;
      margin-right: 100px;
    }
  }
`;

export default Addfood;
